#ISOCountryRegionCodes

void init()
{
    super();
    // <GEERU>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([ #isoRU ]))
    {
        inventTrans_ds.object(fieldNum(InventTrans, ProjId)).visible(true);
    }
    // </GEERU>

    element.updateDesign(InventDimFormDesignUpdate::Init);

    if (element.args().parmEnum() == NoYes::Yes)
    {
        element.design().caption("@SYS1084");
    }

    // Unpack the last query range values from the WHSInventTransFilter
    // combobox and initialize the form with those values.
    xSysLastValue::getLast(this);

    if (this.args() && this.args().caller() && (this.args().caller().name() == formstr(CostAdminWorkspace)))
    {
        whsInventTransFilter.selection(WhsInventTransFilter::OmitWork);
    }
    else
    {
        whsInventTransFilter.selection(whsInventTransFilterVal);
    }

    if (this.isCostingViewEnabled())
    {
        this.enableCostingView();
    }
}

private void enableCostingView()
{
    // Disable inventory fields
    InventTrans_PdsCWQty.visible(false);
    PdsCWUnitId.visible(false);
    InventoryDimensionsGrid.visible(false);

    // Enable costing fields
    CostInventoryDimensionsGrid.visible(true);
    CostInventTransOrigin_InventTransId.visible(true);
    CostInventTrans_ValueOpen.visible(true);
    CostInventTrans_CostAmountSettled.visible(true);
    CostInventTrans_QtySettled.visible(true);
    InventTrans_CostAmountAdjustment.visible(true);
    InventTrans_CostAmountPosted.visible(true);
    InventTrans_CostAmountPhysical.visible(true);
    InventTrans_CostAmountSecCurPhysical_RU.visible(true);
    InventTrans_CostAmountSecCurPosted_RU.visible(true);
    InventTrans_CostAmountSecCurAdjustment_RU.visible(true);
    InventTrans_MarkingRefInventTransOrigin.visible(true);
    InventTrans_ReturnInventTransOrigin.visible(true);
    InventTrans_TransferLotId.visible(true);
    InventTrans_IsNonFinancialTransfer.visible(true);
}

private boolean isCostingViewEnabled()
{
    return (this.args()
         && this.args().menuItemName() == menuitemDisplayStr(CostInventTransVoucher));
}

