public container pack()
{
    return [#CurrentVersion, #CurrentList];
}

public boolean unpack(container _packedClass)
{
    boolean     ret;
    int         version;

    version = conPeek(_packedClass, 1);

    switch (version)
    {
        case #CurrentVersion:
            [version, #CurrentList] = _packedClass;
            ret = true;
            break;
    }

    return ret;
}

void updateDesign(InventDimFormDesignUpdate _mode)
{
    InventDimParm   inventDimParm;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init          :
            InventDimSetupGrid::initInventDimParmInventTrans(inventDimParm);

            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_ActiveRightClick::newFromForm(element);
            }
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);
            inventDimFormSetup.formSetControls(true);
            break;
    }
}

public void init()
{
    InventTrans             inventTransLocal;
    QueryBuildDataSource    qbs;
    Query                   query;

    if (element.args().dataset() == tableNum(InventTrans))
    {
        inventTransLocal = element.args().record() as InventTrans;

        query = new Query();
        qbs = query.addDataSource(tableNum(InventTrans));
        qbs.name(inventTrans_ds.name());

        if (inventTransLocal.isUpdatedFinancial())
        {
            qbs.addDynalink(fieldNum(InventTrans,DateFinancial),
                                element.args().record(), fieldNum(InventTrans,DateFinancial));

            qbs.addDynalink(fieldNum(InventTrans,Voucher),
                                element.args().record(), fieldNum(InventTrans,Voucher));
        }
        else if (inventTransLocal.isUpdatedPhysical())
        {
            qbs.addDynalink(fieldNum(InventTrans,DatePhysical),
                                element.args().record(), fieldNum(InventTrans,DatePhysical));

            qbs.addDynalink(fieldNum(InventTrans,VoucherPhysical),
                                element.args().record(), fieldNum(InventTrans,VoucherPhysical));
        }
        else
        {
            qbs.addRange(fieldNum(InventTrans,RecId)).value(queryValue(-1));
        }

        this.query(query);
    }

    super();

    InventTransFormHelper::formQueryAddDefaultOriginLink(inventTransOrigin_DS, inventTrans_DS);

    if (element.args().dataset() == tableNum(ProjItemTrans))
    {
        qbs = inventTrans_ds.query().dataSourceTable(tableNum(InventTrans));
        qbs.addDynalink(fieldNum(InventTrans, ProjAdjustRefId), element.args().record(), fieldNum(ProjItemTrans, ProjAdjustRefId));
    }

    inventTrans_ds.cacheAddMethod(tableMethodStr(InventTrans, isNonFinancialTransfer));
    inventTrans_ds.cacheAddMethod(tableMethodStr(InventTrans, transferInventTransId));

    inventTrans_ds.cacheAddMethod(tableMethodStr(InventTrans, pdsCWUnitId));
}

